        foundUsers
        } = useContext(AppContext)

        const mappedResults = foundUsers.username && foundUsers.map(item =>
            <ResultDetails
                username={item.username}
                ti
                mood={item.mood && item.mood}

            />
        )

    return(
        <div className='grid bg-cyan-600'>
            {mappedResults}
        </div> 
    )
}
